script: |
  super -f text -I q12052.spq | sort > q12052.out

inputs:
  - name: q12052.spq
    data: |
      SELECT DISTINCT - - ( + col1 ) * + CAST ( + col0 AS INTEGER ) / + col0 + + col1 + + ( col0 ) FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 * + col1 BETWEEN NULL AND - 62;
  - name: tab1

outputs:
  - name: q12052.out
    data: |
